app.controller("CustomRegisterCtrl", function ($scope, $filter, $http, httpService, $stateParams, $ionicPlatform, $ionicPopup, $cordovaCamera, $ionicLoading, $ionicHistory) {

    $scope.input = {
        email: '',
        password: '',
        passwordConf: '',
        username: '',
        meta: {}
    };

    $scope.register_phone_required = register_phone_required;
    $scope.register_address_required = register_address_required;
    $scope.register_message_required = register_message_required;
    $scope.custom_register_fields = !custom_register_fields ? '[]' : JSON.parse(custom_register_fields);
    $scope.default_register_fields = JSON.parse(default_register_fields)[0];
    console.log($scope.custom_register_fields);
    console.log($scope.default_register_fields);

    var loadCustomText = function () {
        $scope.alert_register_success = getMenuText(ui_texts_register.alert_register_success, "Successfully registered. Welcome");
        $scope.alert_register_success_verify = getMenuText(ui_texts_register.alert_register_success_verify, "Successfully registered. Please verify your email before logging in.");
        $scope.alert_register_failed_unknown = getMenuText(ui_texts_register.alert_register_failed_unknown, "Unknown error. Please contact your admin or try again.");
        $scope.alert_register_failed_connection = getMenuText(ui_texts_register.alert_register_failed_connection, "Register failed. Please check your internet connection and try again.");
        $scope.alert_register_failed_field = getMenuText(ui_texts_register.alert_register_failed_field, "Username, Email, and Password must be filled.");
        $scope.alert_register_title = getMenuText(ui_texts_register.alert_register_title, "Register");
        $scope.button_register = getMenuText(ui_texts_register.button_register, "Register");
        $scope.input_error_password_match = getMenuText(ui_texts_register.input_error_password_match, 'Password and Password Confirmation does not match.');

        //input field error
        $scope.input_error_text_must_be_filled = getMenuText(ui_texts_general.input_error_text_must_be_filled, 'must be filled.');
        $scope.input_error_text_wrong_format = getMenuText(ui_texts_general.input_error_text_wrong_format, 'Wrong format for field');
        $scope.input_error_text_please_input_valid = getMenuText(ui_texts_general.input_error_text_please_input_valid, 'please input a valid');
        $scope.input_error_text_min_characters = getMenuText(ui_texts_general.input_error_text_min_characters, 'must be 6 characters minimum.');
        $scope.input_field_type_time = getMenuText(ui_texts_general.input_field_type_time, 'time');
        $scope.input_field_type_date = getMenuText(ui_texts_general.input_field_type_date, 'date');
        $scope.input_field_type_email = getMenuText(ui_texts_general.input_field_type_email, 'email');
        $scope.input_field_type_image = getMenuText(ui_texts_general.input_field_type_image, 'image');
        $scope.input_field_type_password = getMenuText(ui_texts_general.input_field_type_password, 'password');

        // upload image
        $scope.button_text_take_photo = getMenuText(ui_texts_upload_image.button_text_take_photo, "Take Photo");
        $scope.button_text_browse = getMenuText(ui_texts_upload_image.button_text_browse, "Browse Image");
        $scope.button_text_back = getMenuText(ui_texts_upload_image.button_text_back, "Cancel");
        $scope.button_text_change = getMenuText(ui_texts_upload_image.button_text_change, "Change");
        $scope.text_upload_image_modal = getMenuText(ui_texts_upload_image.text_upload_image_modal, "Upload Image");
        $scope.text_upload_image_description = getMenuText(ui_texts_upload_image.text_upload_image_description, "Please upload image using one of the options below.");
        $scope.alert_upload_image_title = getMenuText(ui_texts_upload_image.alert_upload_image_title, "Image Upload");
        $scope.alert_upload_image_success = getMenuText(ui_texts_upload_image.alert_upload_image_success, "Successfully uploaded image.");
        $scope.alert_upload_image_failed_connection = getMenuText(ui_texts_upload_image.alert_upload_image_failed_connection, "Failed to upload image, please check your internet connection and try again.");
        $scope.alert_upload_image_button_try_again = getMenuText(ui_texts_upload_image.alert_upload_image_button_try_again, "Try Again");
        $scope.alert_upload_image_button_ok = getMenuText(ui_texts_upload_image.alert_upload_image_button_ok, "OK");
    };

    loadCustomText();

    $scope.register = function () {
        $scope.show();

        var url = register_url;
        var input = $scope.input;
        console.log("DEVICE_ID");
        console.log(device_id);

        for (var f in $scope.custom_register_fields) {
            if ($scope.custom_register_fields[f].type=="generate_id") {
                input.meta[$scope.custom_register_fields[f].field_key] = $scope.custom_register_fields[f].gen_id_prefix !== undefined? $scope.custom_register_fields[f].gen_id_prefix: '';
            }
            else if ($scope.custom_register_fields[f].type=="admin_generated") {
                input.meta[$scope.custom_register_fields[f].field_key] = $scope.custom_register_fields[f].gen_id_prefix !== undefined? $scope.custom_register_fields[f].gen_id_prefix: '';
            }
        }

        for (var i in input.meta) {
            if (i.indexOf('_date') !== -1) {
                input.meta[i] = new Date(input.meta[i]);
            }
        }

        var tempString = JSON.stringify($scope.input.meta);
        console.log(tempString);
        var obj = serializeData({
            email: input.email,
            password: input.password,
            username: input.username,
            company_id: company_id,
            device_id: device_id,
            meta: tempString
        });

        httpService.post($scope, $http, url, obj, 'register');

    };

    // if get token success, request profile data
    $scope.$on('httpService:postUserRegisterSuccess', function () {
        console.log($scope.data);
        $scope.hide();
        if ($scope.data.success === true) {
            $scope.showRegisterSuccessAlert();
            $ionicHistory.goBack();
        }
        else {
            $scope.showRegisterFailedAlert($scope.data.message);
        }

    });

    // if get token success, request profile data
    $scope.$on('httpService:postUserRegisterError', function () {
        $scope.hide();
        $scope.showFailedAlert();
    });

    $scope.show = function () {
        $ionicLoading.show({
            template: ionicLoadingTemplate
        });
    };

    $scope.hide = function () {
        $ionicLoading.hide();
    };

    $scope.showRegisterSuccessAlert = function (username) {
        var textAlertSuccess = verify_user_register_enabled ?
          $scope.alert_register_success_verify : ($scope.alert_register_success + " " + $scope.input.username);

        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_register_title,
            css: 'cp-button',
            okType: 'cp-button',
            template: '<div style="width:100%;text-align:center">' + textAlertSuccess + '</div>'
        });
    };

    $scope.showRegisterFailedAlert = function (message) {
        if (message == undefined || message == false || message == null)
            message = $scope.alert_register_failed_unknown;

        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_register_title,
            css: 'cp-button',
            okType: 'cp-button',
            template: '<div style="width:100%;text-align:center">'+message+'</div>'
        });
    };

    $scope.showFailedAlert = function () {
        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_register_title,
            css: 'cp-button',
            okType: 'cp-button',
            template: '<div style="width:100%;text-align:center">' + $scope.alert_register_failed_connection + '</div>'
        });
    };

    $scope.showRequirementAlert = function () {
        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_register_title,
            css: 'cp-button',
            okType: 'cp-button',
            template: '<div style="width:100%;text-align:center">' + $scope.alert_register_failed_field + '</div>'
        });
    };


    $scope.takePhoto = function (field_key) {
        if (!isPhoneGap()) {
            console.log("Not in a mobile device");
//            $scope.input.email = "asdasd@asd";
//            $scope.input.password = "asdasd";
//            $scope.input.passwordConf = "asdasd";
//            $scope.input.username = "asdasd";
            $scope.input.meta[field_key] =  "data:image/jpeg;base64,";
            console.log($scope.input);
            return;
        }
        var options = {
            quality: 100,
            destinationType: Camera.DestinationType.DATA_URL,
            sourceType: Camera.PictureSourceType.CAMERA,
            allowEdit: true,
            encodingType: Camera.EncodingType.JPEG,
            targetWidth: 640,
            targetHeight: 640,
            popoverOptions: CameraPopoverOptions,
            saveToPhotoAlbum: false
        };

        $cordovaCamera.getPicture(options).then(function (imageData) {
            $scope.input.meta[field_key] =  "data:image/jpeg;base64," + imageData;
        }, function (err) {
            if(err == "Selection cancelled.") {
                //do Nothing
            }
            else if(err == "Camera cancelled.") {
                // do Nothing
            }
            else {
                $scope.uploadPhotoFailed();
            }
        });
    };

    $scope.choosePhoto = function (field_key) {
        if (!isPhoneGap()) {
            console.log("Not in a mobile device");
//            $scope.input.email = "asdasd@asd";
//            $scope.input.password = "asdasd";
//            $scope.input.passwordConf = "asdasd";
//            $scope.input.username = "asdasd";
            $scope.input.meta[field_key] =  "data:image/jpeg;base64,";
            console.log($scope.input);
            return;
        }
        var options = {
            quality: 100,
            destinationType: Camera.DestinationType.DATA_URL,
            sourceType: Camera.PictureSourceType.PHOTOLIBRARY,
            allowEdit: true,
            encodingType: Camera.EncodingType.JPEG,
            targetWidth: 640,
            targetHeight: 640,
            popoverOptions: CameraPopoverOptions,
            saveToPhotoAlbum: false
        };

        $cordovaCamera.getPicture(options).then(function (imageData) {
            $scope.input.meta[field_key] =  "data:image/jpeg;base64," + imageData;
        }, function (err) {
            if(err == "Selection cancelled.") {
                //do Nothing
            }
            else if(err == "Camera cancelled.") {
                // do Nothing
            }
            else {
                $scope.uploadPhotoFailed();
            }
        });
    };

    $scope.showUploadSelection = function (field_key) {
        var alertPopup = $ionicPopup.alert({
            title: $scope.text_upload_image_modal,
            template: '<div style="width:100%;text-align:center">'+$scope.text_upload_image_description+'</div>',
            cssClass: 'popup-vertical-buttons',
            buttons:[
                {
                    text: $scope.button_text_take_photo,
                    type: 'cp-button button-block',
                    onTap: function(e)
                    {
                        $scope.takePhoto(field_key);
                    }
                },
                {
                    text: $scope.button_text_browse,
                    type: 'cp-button button-block',
                    onTap: function(e)
                    {
                        $scope.choosePhoto(field_key);
                    }
                },
                {
                    text: $scope.button_text_back
                }
            ]
        });
    };

    $scope.uploadPhotoSuccess = function () {
        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_upload_image_title,
            template: '<div style="width:100%;text-align:center">' + $scope.alert_upload_image_success + '</div>',
            buttons: [
                {
                    text: $scope.alert_upload_image_button_ok,
                    type: 'cp-button'
                }
            ]
        });
    };

    $scope.uploadPhotoFailed = function () {
        var alertPopup = $ionicPopup.alert({
            title: $scope.alert_upload_image_title,
            template: '<div style="width:100%;text-align:center">' + $scope.alert_upload_image_failed_connection + '</div>',
            buttons: [
                {
                    text: $scope.alert_upload_image_button_try_again,
                    type: 'cp-button'
                    // onTap: function(e) {
                    //     $scope.choosePhoto($scope.trans_id);
                    // }
                }
            ]
        });
    };


});

